export default function Layout() {
  return (
    <div className="card-container !h-[60vh] rounded-md bg-[var(--dark-desaturated-blue)] !w-[70vw]">
      <div className="card-container-description">
        <h3>Get insights that help your business grow.</h3>
        <p>
          Discover the benefits of data analytics and make better decisions
          regarding revenue, customer experience, and overall effeciency
        </p>
      </div>
      <div className="card-container-image"></div>
    </div>
  );
}
